The architects took wooden shingles, used traditionally, and combined them with polycarbonate sheets of the same size, layered like fish scales to create a watertight architectural plane. The small shingle pieces were all cut from leftover timber, and the polycarbonate sheets were designed in consideration of market-size sheeting to avoid waste. On the front of the building, a combination of wooden shingles and translucent polycarbonate sheets create a fading effect and the fa√ßade captures light and reflections from its riverbank location.
